This series ran concurrently with other Judge Dredd material such as 2000AD, and tried to capitalize on the Stallone film with a somewhat more child-friendly tone (an obvious mistake since that movie was a steaming pile of shit). This torrent contains all 23 issues of the series + the Action Special. Thanks to Zeg and The Baron for the scans, please seed and enjoy! :-)
